import './App.css';
import Navbar from './components/Navbar';
import Login from './components/Login';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";



function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route exact path='/login' element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
